import React, { useState } from 'react'
import styles from './List.module.css'
import {v1} from 'uuid'
import { useDispatch } from 'react-redux';
import {actions} from './../../'

const SearchInput = () => {
    const [value,setValue] = useState('')
    const dispatch = useDispatch()
    const addPurpose = (e) => {
        e.preventDefault()        
        dispatch(setNewPurpose({id:v1(),text:value,data:'15/03/23'}))
    }
    return(
        <>
            <form onSubmit={(e) => addPurpose(e)}>
                <input type="text"  placeholder="Ceate new part of your list" value={value} onChange={(e) => setValue(e.currentTarget.value)} className={styles.searchInput}/>
                <input type="submit"/>
            </form>
        </>
    )
}

export default SearchInput
